import { ScrollView, StyleSheet } from 'react-native';
import { CardSessionStat } from '../components/Card/CardSessionStat/CardSessionStat';
import { CardCurrentTherapy } from '../components/Card/CardCurrentTherapy';
import { CardDeviceSetup } from '../components/Card/CardDeviceSetup';
import { CardGetFamiliar } from '../components/Card/CardGetFamiliar';
import { CardRating } from '../components/Card/CardRating';
import { CardRecommendation } from '../components/Card/CardRecommendation';
import { CardReminder } from '../components/Card/CardReminder';
import { CardTremorTasks } from '../components/Card/CardTremorTasks/CardTremorTasks';
import { CardWaveform } from '../components/Card/CardWaveform';
import { CardWaveform2 } from '../components/Card/CardWaveform2/CardWaveform2';

export const AllCardsScreen = ({ navigation }) => {
  return (
    <ScrollView contentContainerStyle={styles.container}>
      <CardSessionStat />
      <CardCurrentTherapy />
      <CardDeviceSetup />
      <CardGetFamiliar />
      <CardWaveform />
      <CardRating size="tall" />
      <CardRecommendation size="short" />
      <CardReminder size="short" />
      <CardTremorTasks size="tall" />

      <CardWaveform2 size="tall" />
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    display: 'flex',
    flexDirection: 'column',
    flex: 1,
    justifyContent: 'space-around',
    width: '100%',
    paddingHorizontal: 30,
    backgroundColor: Colors.WHITE,
    //backgroundColor: 'red',
  },
});
